import React from 'react';
import home from "./img/home.jpg";
import sofa from "./img/sofa.jpg";

const Main = () => {
    return (
        <>
            <div className="container">
               <div className="row col-md-12">
                   <img src={home} alt="" />
               </div>

               <div className="row">
                   <div className="col-md-6">
                       <div className="col-md-3">
                           <img src={sofa} alt="" />
                       </div>
                   </div>
               </div>
            </div>
        </>
    )
}

export default Main;
